import React, { useState } from "react";
import Advertisements from "./advertisements";
import Companies from "./companies";
import Applications from "./applications";
import Users from "./users";
import "./form.css";

const NavBar = () => {
    const [currentPage, setCurrentPage] = useState("advertisements");

    const renderPage = () => {
        switch (currentPage) {
            case "advertisements":
                return <Advertisements />;
            case "companies":
                return <Companies />;
            case "applications":
                return <Applications />;
            case "users":
                return <Users />;
            default:
                return <Advertisements />;
        }
    };

    return (
        <div>
            <section className="tabs">
                <div className="tabs-container">
                    <button
                        className="tab"
                        onClick={() => setCurrentPage("advertisements")}
                    >
                        Advertisements
                    </button>
                    <button
                        className="tab"
                        onClick={() => setCurrentPage("companies")}
                    >
                        Companies
                    </button>
                    <button
                        className="tab"
                        onClick={() => setCurrentPage("applications")}
                    >
                        Applications
                    </button>
                    <button
                        classNametab
                        onClick={() => setCurrentPage("users")}
                    >
                        Users
                    </button>
                </div>
            </section>
            <div>{renderPage()}</div>
        </div>
    );
};

export default NavBar;
